(3, 1, 1, 'Boutique', '<p style=\"line-height:100%;margin-bottom:0cm;\">Bienvenue dans notre magasin de magie !</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Que vous soyez à la recherche de cailloux magiques pour amplifier vos sorts, de pyramides pour concentrer l\'énergie positive, de boîtes de rangement pour protéger vos précieux trésors ou d\'attrape-rêves pour une nuit de sommeil paisible, vous trouverez tout ce qu\'il vous faut ici.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Nous avons une sélection unique de produits magiques pour tous les besoins et tous les budgets. Alors n\'hésitez plus et venez découvrir notre magasin de magie pour une vie enchantée !</p>', 'boutique', '', '', ''),
