(4, 1, 1, 'Minéraux', '<p style=\"line-height:100%;margin-bottom:0cm;\">Donnez un coup de pouce à votre magie quotidienne avec ces minéraux magiques !</p>\r\n<p></p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Avec leurs formes uniques et leurs couleurs vibrantes, ils sont parfaits pour attirer l\'énergie positive et amplifier vos sorts.</p>\r\n<p></p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Et grâce à leur taille compacte, vous pouvez les emporter partout avec vous pour une magie à portée de main.</p>\r\n<p></p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Alors n\'hésitez plus et offrez-vous ces minéraux magiques pour une vie enchantée !</p>', 'mineraux', 'Minéraux', '', 'Minéraux'),
