(5, 1, 1, 'Pyramides', '<p style=\"line-height:100%;margin-bottom:0cm;\">Vous cherchez une manière originale de dynamiser votre magie ?</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Ces petites pyramides magiques sont faites pour vous !</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Avec leur forme symbolique et leur surface brillante, elles sont parfaites pour concentrer l\'énergie et renforcer vos pouvoirs.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Et grâce à leur taille discrète, vous pouvez les emporter partout avec vous pour une magie toujours à portée de main.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Alors n\'hésitez plus et offrez vous ces petites pyramides magiques pour une vie magique !</p>', 'pyramides', '', '', ''),
