(6, 1, 1, 'Boîte de rangement', '<p style=\"line-height:100%;margin-bottom:0cm;\">Vous êtes à la recherche d\'un moyen élégant de ranger vos cailloux magiques ?</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Ces boîtes en bois sont faites pour vous !</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Avec leur design intemporel et leur finition soignée, elles s\'intégreront parfaitement à n\'importe quel intérieur.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Et grâce à leurs couvercles étanches, vos cailloux resteront en parfait état même s\'il pleut dehors.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Alors n\'hésitez plus et offrez vous ces boîtes en bois pour vos cailloux magiques !</p>', 'boite-de-rangement', '', '', ''),
