(7, 1, 1, 'Attrape-rêves', '<p style=\"line-height:100%;margin-bottom:0cm;\">Offrez-vous une nuit de sommeil paisible avec ces attrape-rêves !</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Avec leur forme aérienne et leur toile fine, ils sont parfaits pour capturer les mauvais rêves et laisser passer les bons.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Et grâce à leur design élégant, ils sont aussi une jolie décoration pour votre chambre.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Alors n\'hésitez plus et offrez-vous ces attrape-rêves pour des nuits de rêve !</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"></p>', 'attrape-reves', '', '', ''),
