INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `head_seo_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Livraison', '', 'Nos conditions de livraison', 'conditions, livraison, délais, expédition, colis', '<h2>Expéditions et retours</h2>\r\n<h3>Expédition de votre colis</h3>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Tout d\'abord, sachez que nous expédions nos colis avec UPS, le roi de la livraison rapide et sécurisée.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Ils vont prendre soin de votre caillou magique comme s\'il était leur propre bébé.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Si vous le souhaitez, vous pouvez même opter pour la livraison UPS Extra, qui remet votre colis contre signature.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Comme ça, vous êtes sûr qu\'il ne tombe pas entre de mauvaises mains (par exemple, celles de votre voisin jaloux).</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Pour suivre votre colis, rien de plus simple : nous vous envoyons un lien magique qui vous permettra de le localiser en temps réel. Vous verrez, c\'est fascinant !</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Mais attention, les expéditions et les retours, c\'est aussi une question de responsabilité. Si vous avez des problèmes avec votre colis (par exemple, s\'il est arrivé cassé ou si vous avez changé d\'avis), n\'hésitez pas à nous contacter.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Nous sommes là pour vous aider et pour nous assurer que votre expérience de caillou magique soit la meilleure possible.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"></p>', 'livraison'),
(1, 2, 1, 'Lieferung', '', 'Unsere Lieferbedingungen', 'Bedingungen, Lieferung, Frist, Versand, Verpackung', '<h2>Versand und Rücknahme</h2>\r\n<h3>Ihre Versandverpackung</h3>\r\n<p>Pakete werden normalerweise 2 Tage nach Zahlungseingang mit UPS mit Bestellverfolgemöglichkeit und Ablieferung ohne Unterschrift geliefert. Wenn Sie lieber eine UPS-Sendung per Einschreiben erhalten möchten, entstehen zusätzliche Kosten. Bitte kontaktieren Sie uns, bevor Sie dieses Liefermethode wählen. Wir senden Ihnen einen Link für die Bestellverfolgung unabhängig davon, welche Liefermethode Sie wählen.</p>\r\n<p>Die Versandkosten beinhalten Lade- und Verpackungsgebühren sowie die Portokosten. Die Verladegebühren stehen fest, wobei Transportkosten schwanken, je nach Gesamtgewicht des Pakets. Wir raten Ihnen, mehrere Artikel in einer Bestellung zusammenzufassen. Wir können zwei verschiedene Bestellungen nicht zusammenlegen, und die Versandkosten werden separat für jede Bestellung gerechnet. Ihr Paket wird auf Ihr Risiko versandt, aber zerbrechliche Ware wird besonders sorgsam behandelt.<br /><br />Die Versandschachteln sind weit geschnitten und ihre Ware wird gut geschützt verpackt.</p>', 'Lieferung'),
(1, 3, 1, 'Levering', '', 'Onze leveringsvoorwaarden', 'voorwaarden, levering, vertraging, verzending, pakket', '<h2>Zendingen en retourzendingen</h2>\r\n<h3>Verzending van uw pakket</h3>\r\n<p>Pakketten worden over het algemeen binnen 2 dagen na ontvangst van uw betaling verzonden via UPS met tracking en aflevering zonder handtekening. Als u de voorkeur geeft aan verzending via UPS Extra met vereiste handtekening, zullen er extra kosten in rekening worden gebracht. Neem contact met ons op voordat u deze bezorgwijze kiest. Welke verzending u ook kiest, u krijgt van ons een trackingnummer waarmee u uw pakket online kunt volgen.</p>\r\n<p>Verzendkosten zijn inclusief behandeling, verpakking en frankering. Behandelingskosten zijn vaste bedragen, terwijl vervoerskosten afhankelijk zijn van het totaalgewicht. We raden u aan uw artikelen onder te brengen in één bestelling. We kunnen twee apart geplaatste bestellingen niet samenvoegen, voor elke bestelling zullen dus verzendkosten in rekening worden gebracht. Uw pakket wordt op eigen risico verzonden, maar er wordt bijzondere zorg besteed aan breekbare voorwerpen.<br /><br />Onze dozen zijn groot genoeg om uw artikelen goed beschermd te kunnen verzenden.</p>', 'levering'),
(1, 4, 1, 'Livraison', '', 'Nos conditions de livraison', 'conditions, livraison, délais, expédition, colis', '<h2>Expéditions et retours</h2>\r\n<h3>Expédition de votre colis</h3>\r\n<p>Les colis sont généralement expédiés dans un délai de 2 jours après réception du paiement. Ils sont expédiés via UPS avec un numéro de suivi et remis sans signature. Les colis peuvent également être expédiés via UPS Extra et remis contre signature. Veuillez nous contacter avant de choisir ce mode de livraison, car il induit des frais supplémentaires. Quel que soit le mode de livraison choisi, nous vous envoyons un lien pour suivre votre colis en ligne.</p>\r\n<p>Les frais d\'expédition incluent les frais de préparation et d\'emballage ainsi que les frais de port. Les frais de préparation sont fixes, tandis que les frais de transport varient selon le poids total du colis. Nous vous recommandons de regrouper tous vos articles dans une seule commande. Nous ne pouvons regrouper deux commandes placées séparément et des frais d\'expédition s\'appliquent à chacune d\'entre elles. Votre colis est expédié à vos propres risques, mais une attention particulière est portée aux objets fragiles.<br /><br />Les dimensions des boîtes sont appropriées et vos articles sont correctement protégés.</p>', 'livraison'),
(1, 5, 1, 'Livraison', '', 'Nos conditions de livraison', 'conditions, livraison, délais, expédition, colis', '<h2>Expéditions et retours</h2>\r\n<h3>Expédition de votre colis</h3>\r\n<p>Les colis sont généralement expédiés dans un délai de 2 jours après réception du paiement. Ils sont expédiés via UPS avec un numéro de suivi et remis sans signature. Les colis peuvent également être expédiés via UPS Extra et remis contre signature. Veuillez nous contacter avant de choisir ce mode de livraison, car il induit des frais supplémentaires. Quel que soit le mode de livraison choisi, nous vous envoyons un lien pour suivre votre colis en ligne.</p>\r\n<p>Les frais d\'expédition incluent les frais de préparation et d\'emballage ainsi que les frais de port. Les frais de préparation sont fixes, tandis que les frais de transport varient selon le poids total du colis. Nous vous recommandons de regrouper tous vos articles dans une seule commande. Nous ne pouvons regrouper deux commandes placées séparément et des frais d\'expédition s\'appliquent à chacune d\'entre elles. Votre colis est expédié à vos propres risques, mais une attention particulière est portée aux objets fragiles.<br /><br />Les dimensions des boîtes sont appropriées et vos articles sont correctement protégés.</p>', 'livraison'),
