(2, 1, 1, 'Mentions légales', 'Mentions légales', 'Mentions légales', 'mentions, légales, crédits', '<h2 style=\"text-align:left;\">Mentions légales</h2>\r\n<p style=\"text-align:left;\"></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:left;\"></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:left;\"><strong>Tous les cailloux magiques proposés sur notre site sont garantis 100% authentiques et dotés de pouvoirs magiques réels. </strong></p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:left;\"><strong>Si vous n\'êtes pas satisfait de votre achat, vous ne serez pas satisfait en lisant la suite</strong></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:left;\"><br /><strong>Les photographies des cailloux magiques sur notre site sont contractuelles. </strong></p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:left;\"><strong>Si vous recevez un caillou qui ne ressemble pas à ce que vous aviez vu sur l\'image, cela signifie que vous avez été choisi par les esprits pour recevoir un caillou encore plus magique. </strong></p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:left;\"><strong>Félicitations !</strong><br /><br /><strong></strong><strong>Les textes et les images présents sur notre site sont protégés par les lois sur la propriété intellectuelle. </strong></p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:left;\"><strong>Toute reproduction, même partielle, est interdite (sauf si vous nous en demandez l\'autorisation).</strong><br /><br /><strong>Notre entreprise se dégage de toute responsabilité en cas d\'utilisation abusive ou irresponsable de nos cailloux magiques. </strong></p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:left;\"><strong>Nous vous rappelons qu\'il ne faut pas essayer de manger les cailloux, de les lancer sur les gens ou de les utiliser comme substitut à un traitement médical. </strong></p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:left;\"><strong>Si vous avez des problèmes de santé, consultez un professionnel de santé.<br /><br /></strong></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"><em><b>Les éléments de notre boutique sont pleins de surprises ! Prenez le temps de regarder partout et peut-être découvrirez vous des secrets cachés</b></em></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:left;\"><br /><strong>En utilisant notre site et en achetant nos cailloux magiques, vous acceptez nos conditions générales de vente.<br /><br />Si vous avez des questions ou des commentaires, n\'hésitez pas à nous contacter. </strong></p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:left;\"><strong>Nous sommes là pour vous aider et pour rendre votre vie un peu plus magique !</strong><br /><br /><br /></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:left;\"><strong></strong></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:left;\"><strong></strong></p>\r\n<!-- CA CHAUFFE, Bravo vous avez compris mais la récompense ne se trouve pas sur cette page -->', 'mentions-legales'),
(2, 2, 1, 'Rechtliche Hinweise', '', 'Rechtliche Hinweise', 'Hinweise, rechtlich, Gutscheine', '<h2>Legal</h2>\r\n<h3>Credits</h3>\r\n<p>Konzept und Gestaltung:</p>\r\n<p>Diese Webseite wurde hergestellt unter Verwendung von <a href=\"http://www.prestashop.com\">PrestaShop</a>™ open-source software.</p>', 'rechtliche-hinweise'),
(2, 3, 1, 'Wettelijke Mededeling', '', 'Wettelijke mededeling', 'mededeling, wettelijk, kredieten', '<h2>Wettelijk</h2>\r\n<h3>Kredieten</h3>\r\n<p>Concept en productie:</p>\r\n<p>Deze Webwinkel is opgezet met <a href=\"http://www.prestashop.com\">Prestashop Webwinkel Software</a>, op Prestashop\'s <a href=\"http://www.prestashop.com/blog/en/\">e-commerce blog</a> vindt u nieuws en advies over online verkopen en het runnen van uw e-commerce website.</p>', 'wettelijke-mededeling'),
