(3, 1, 1, 'Conditions d\'utilisation', '', 'Nos conditions d\'utilisation', 'conditions, utilisation, vente', '<h1 class=\"page-heading\">Conditions d\'utilisation</h1>\r\n<h3 class=\"page-subheading\">Règle n° 1</h3>\r\n<p>Ne pas essayer de manger les cailloux magiques. Même s\'ils ont l\'air très appétissants, ce n\'est pas parce qu\'une pierre est magique qu\'elle est comestible.</p>\r\n<h3 class=\"page-subheading\">Règle n° 2</h3>\r\n<p class=\"bottom-indent\">Ne pas utiliser les cailloux magiques comme projectile. Même s\'ils peuvent être très lourds et durs, ils ne sont pas faits pour être lancés sur les gens. Cela peut causer des dommages graves et, surtout, cela va à l\'encontre de l\'énergie positive que les cailloux magiques essaient de véhiculer.</p>\r\n<h3 class=\"page-subheading\">Règle n° 3</h3>\r\n<p class=\"bottom-indent\">Ne pas confondre les cailloux magiques avec des cailloux ordinaires. Ne prenez pas n\'importe quel caillou et n\'essayez pas de lui attribuer des pouvoirs magiques. Cela ne fonctionnera pas et vous pourriez être très déçu.</p>\r\n<p class=\"bottom-indent\">Si vous voulez profiter des bienfaits des cailloux magiques, assurez vous de vous procurer de véritables pierres magiques auprès d\'un vendeur fiable.</p>', 'conditions-utilisation'),
(3, 2, 1, 'Allgemeine Geschäftsbedingungen', '', 'Unsere AGB', 'AGB, Bedingungen, Nutzung, Verkauf', '<h2>Ihre AGB</h2>\r\n<h3>Rule 1</h3>\r\n<p>Here is the rule 1 content</p>\r\n<h3>Rule 2</h3>\r\n<p>Here is the rule 2 content</p>\r\n<h3>Rule 3</h3>\r\n<p>Here is the rule 3 content</p>', 'allgemeine-geschaeftsbedingungen'),
