(4, 1, 1, 'A propos', '', 'En savoir plus sur notre entreprise', 'à propos, informations', '<h1 class=\"page-heading bottom-indent\">A propos</h1>\r\n<div class=\"row\">\r\n<div class=\"col-xs-12 col-sm-4\">\r\n<div class=\"cms-block\">\r\n<h3 class=\"page-subheading\"><span style=\"text-decoration:underline;\">Notre entreprise</span></h3>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Bienvenue dans notre boutique de cailloux magiques \"Magic Pebble\" !</p>\r\n<br />\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Nous sommes une petite entreprise de dingues, passionnés de minéraux et de magie.</p>\r\n<br />\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Depuis notre création, nous avons consacré notre vie à trouver les meilleures pierres magiques de l\'univers et à les mettre à la disposition de tous ceux qui en ont besoin.</p>\r\n<br />\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Nous croyons sincèrement que les cailloux magiques peuvent transformer la vie de chacun et c\'est pour cette raison que nous les proposons à des prix <strong>abordables</strong>.</p>\r\n<br />\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Nous sommes persuadés que tout le monde mérite d\'avoir accès à la magie, qu\'importe son budget.</p>\r\n<br />\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Alors n\'hésitez pas à parcourir notre boutique en ligne et à découvrir toutes les merveilles que nous avons à vous offrir.</p>\r\n<br />\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Et si vous avez des questions, n\'hésitez pas à nous contacter.</p>\r\n<br />\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"><em>Nous sommes là pour vous aider à trouver</em> la pierre magique qui vous convient le mieux !</p>\r\n<br />\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"></p>\r\n</div>\r\n</div>\r\n<div class=\"col-xs-12 col-sm-4\">\r\n<div class=\"cms-box\">\r\n<h3 class=\"page-subheading\" style=\"text-align:left;\"><span style=\"text-decoration:underline;\">Témoignages</span></h3>\r\n<div class=\"testimonials\">\r\n<div class=\"inner\" style=\"text-align:left;\"><strong>Céline</strong> : Je suis absolument ravi de mon achat !</div>\r\n<br />\r\n<div class=\"inner\" style=\"text-align:left;\">J\'ai acheté un caillou de chance (Œil-de-tigre) il y a quelques semaines et depuis, ma vie a complétement changé.</div>\r\n<br />\r\n<div class=\"inner\" style=\"text-align:left;\">Tout d\'abord, j\'ai gagné à la loterie (ce qui est plutôt rare, je vous l\'assure).</div>\r\n<br />\r\n<div class=\"inner\" style=\"text-align:left;\">Ensuite j\'ai réussi à trouver un emploi mieux payé et avec des horaires plus flexibles.</div>\r\n<br />\r\n<div class=\"inner\" style=\"text-align:left;\">Et pour couronner le tout, mon copain m\'a dit qu\'il était enceinte !</div>\r\n<br />\r\n<div class=\"inner\" style=\"text-align:left;\">Je ne sais pas comment expliquer tout ça, mais je suis persuadé que \'est grâce a mon caillou magique.</div>\r\n<br />\r\n<div class=\"inner\" style=\"text-align:left;\">Je le porte toujours sur moi et je le caresse chaque fois que je suis stressé ou anxieuse.</div>\r\n<br />\r\n<div class=\"inner\" style=\"text-align:left;\">C\'est un véritable talisman et je le recommande a tout le monde ! </div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- INDICE : Avec quoi tourne t\'on les pages d\'un livre ?  -->', 'a-propos'),
