(6, 1, 1, 'Introduction bien être', 'Conseils d\'utilisation', 'Conseils d\'utilisation', 'Conseils d\'utilisation', '<p style=\"text-align:center;\">Vous avez des problèmes de santé ?<br /><br />Vous vous sentez stressé, anxieux ou déprimé ?<br /><br />Vous avez un mauvais Karma ? Aucun problème !<br /><br />Il suffit de vous procurer quelques pierres magiques et votre vie sera transformée !<br /><br /><br /><br /><br />Le quartz, par exemple, est une pierre absolument incroyable.<br /><br />Cette petite merveille de la nature peut tout soigner, du rhume de cerveau au cancer en passant par l\'herpès génital.</p>\r\n<p style=\"text-align:center;\"><br /><br />Il suffit de le porter sur vous ou de le placer sous votre oreiller pour que tous vos maux disparaissent comme par magie.<br /><br /><br /><br />Mais le quartz n\'est pas le seul minéral à posséder des pouvoirs curatifs.<br /><br /><br /><br />Il existe des dizaines d\'autres pierres magiques, chacune dotée de ses propres vertus.<br /><br /><br /><br />La citrine, par exemple, est idéale pour attirer l\'abondance et la prospérité dans votre vie.<br /><br /><br /><br />Le jaspe rouge, quant à lui, est parfait pour renforcer votre aura et vous protéger des mauvaises vibrations.<br /><br /><br /><br />Alors n\'hésitez plus, investissez dans quelques pierres magiques et dites adieu à tous vos problèmes !<br /><br /><br /><br />Vous verrez, vous serez étonné par les résultats.<br /><br /><br /><br />Enfin, si vous n\'y croyez pas vraiment, vous pouvez toujours vous dire que cela ne coûte rien d\'essayer.<br /><br /><br /><br />Qui sait, peut-être que les pierres magiques vous surprendront agréablement ?<br /><br /><br /><br /></p>\r\n<p style=\"text-align:center;\"><img src=\"http://localhost/Prestashop/img/cms/mascot%20stone%20magic.png\" alt=\"\" width=\"500\" height=\"500\" /></p>', 'introduction-bien-etre-'),
