(7, 1, 1, 'Entretien', 'Entretien', 'Entretien', 'Entretien', '<p style=\"line-height:100%;margin-bottom:0cm;\">Ne mettez pas vos pierres magiques au micro-ondes ! Elles ne vont pas aimer et vous allez perdre tout leur pouvoir.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Ne mettez pas vos pierres magiques au lave-vaisselle ! Elles vont se sentir malmenées et vous allez perdre tout leur charme.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Ne jetez pas vos pierres magiques par la fenêtre ! Elles ne vont pas aimer et vous allez perdre tout leur potentiel.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Ne faites pas de feu avec vos pierres magiques ! Elles ne vont pas apprécier et vous allez perdre tout leur éclat.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Ne les laissez pas tomber ! Elles sont fragiles et vous allez perdre tout leur énergie.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Ne les exposez pas aux rayons UV ! Elles vont s\'assombrir et vous allez perdre tout leur pouvoir de guérison.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Ne les mettez pas dans un sac en plastique ! Elles vont étouffer et vous allez perdre tout leur souffle de vie.</p>\r\n<p></p>\r\n<p>N\'oubliez pas de les recharger de temps en temps ! Elles ont besoin de se nourrir de l\'énergie de la lune et du soleil pour rester en forme.</p>\r\n<p></p>\r\n<p>Ne les laissez pas s\'ennuyer ! Elles ont besoin de se divertir et d\'interagir avec vous pour rester en forme.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Alors prenez le temps de les caresser, de les parler, de les mettre en valeur et de les chouchouter.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Vous verrez, elles vous le rendront bien !</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"></p>', 'entretien'),
