(329, 5, 'Puede darse de baja en cualquier momento. Para ello, consulte nuestra información de contacto en el aviso legal.', '2022-12-19 17:47:46'),
(329, 6, 'Puoi annullare l\'iscrizione in ogni momenti. A questo scopo, cerca le info di contatto nelle note legali.', '2022-12-19 17:47:46'),
