INSERT INTO `ps_info_lang` (`id_info`, `id_shop`, `id_lang`, `text`) VALUES
(1, 1, 1, '<p style=\"line-height:100%;margin-bottom:0cm;text-align:center;\">Bienvenue sur Magic Pebble, le seul endroit où vous pouvez trouver les cailloux les plus magiques de tous les temps !</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:center;\">Nous avons toutes sortes de cailloux, des plus petits aux plus gros, des plus simples aux plus complexes.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:center;\">Que vous cherchiez un caillou qui vous rendra invisible, un caillou qui vous donnera la richesse et la gloire, ou un caillou qui vous aidera à trouver l\'amour de votre vie, nous avons ce qu\'il vous faut.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:center;\">Et pour ceux qui ne sont pas sûrs de ce qu\'ils cherchent, pas de souci !</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:center;\">Notre équipe d’experts est là pour vous guider et vous aider à trouver le caillou magique qui répondra à toutes vos attentes.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:center;\">Alors n\'hésitez pas, venez nous rendre visite et découvrez le monde merveilleux des cailloux magiques !</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;text-align:center;\"></p>\r\n<!-- Bravo ! Tu as découvert le code de réduction Easter Egg !!!CODE : W3XKT363H52VWZ8M  -->'),
