INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1, 1, 1, '<p><strong>Le pack contient</strong></p>\r\n<p>- Une Boite en carton recyclé sans gluten</p>\r\n<p>- Un Sac en cuir de licorne</p>\r\n<p>- Un Guide initiatique à la magie des cailloux</p>\r\n<p>- 12 Pierres sélectionnées à la main par un moine tibétain</p>', '<p style=\"line-height:100%;margin-bottom:0cm;\">Attention, les amis des cailloux magiques !</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Nous avons le plaisir de vous présenter notre tout nouveau kit </p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">12 cailloux différents pour répondre à tous vos besoins magiques !</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Vous trouverez dans ce kit des pierres pour la sagesse, l\'amour, la chance, la protection, la confiance en soi et bien d\'autres encore.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Il y en a pour tous les goûts et pour toutes les situations.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Vous n\'aurez plus jamais à vous ennuyer avec un seul caillou !</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Alors ne manquez pas cette occasion de devenir le roi ou la reine des cailloux magiques. Commandez dès maintenant notre kit de l\'incroyable et laissez la magie entrer dans votre vie !</p>', 'kit-cure-de-jouvance', '', '', '', 'Kit cure de jouvance', '', '', '', ''),
