(2, 1, 1, '<p style=\"line-height:100%;margin-bottom:0cm;\"><span><span style=\"color:#000000;\"><span style=\"font-family:Manrope, sans-serif;\"><span style=\"font-size:9pt;\">Matériau : 100% pierre de cristal de Quartz naturel</span></span></span></span><br /><br /><span><span style=\"color:#000000;\"><span style=\"font-family:Manrope, sans-serif;\"><span style=\"font-size:9pt;\">Couleur : comme l\'image</span></span></span></span><br /><br /><span><span style=\"color:#000000;\"><span style=\"font-family:Manrope, sans-serif;\"><span style=\"font-size:9pt;\">Quantité : 1 pièce</span></span></span></span><br /><br /><span><span style=\"color:#000000;\"><span style=\"font-family:Manrope, sans-serif;\"><span style=\"font-size:9pt;\">Forme : comme l\'image</span></span></span></span><br /><br /><span><span style=\"color:#000000;\"><span style=\"font-family:Manrope, sans-serif;\"><span style=\"font-size:9pt;\">Niveau : haute qualité : (AAAA +)</span></span></span></span></p>\r\n<p style=\"line-height:15px;margin-bottom:0cm;text-align:left;\"></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"></p>\r\n<p></p>\r\n<p style=\"line-height:15px;margin-bottom:0cm;text-align:left;\"></p>\r\n<p style=\"line-height:15px;margin-bottom:0cm;text-align:left;\"><iframe width=\"425\" height=\"350\" src=\"http://www.youtube.com/embed/RQG7zQaVztg\"></iframe></p>\r\n<p></p>', '<p style=\"line-height:15px;margin-bottom:0cm;text-align:left;\">Le quartz rose, c\'est la pierre de l\'amour !</p>\r\n<p></p>\r\n<p style=\"line-height:15px;margin-bottom:0cm;text-align:left;\">Cette petite merveille de la nature est parfaite pour tous ceux qui cherchent à attirer l\'amour, l\'amitié ou tout simplement une bonne dose de tendresse dans leur vie.</p>\r\n<p></p>\r\n<p style=\"line-height:15px;margin-bottom:0cm;text-align:left;\">Si vous êtes célibataire depuis un moment et que vous en avez assez d\'être seul, le quartz rose est fait pour vous.</p>\r\n<p></p>\r\n<p style=\"line-height:15px;margin-bottom:0cm;text-align:left;\"></p>\r\n<p></p>\r\n<p style=\"line-height:15px;margin-bottom:0cm;text-align:left;\">Mais attention, le quartz rose n\'est pas seulement réservé aux cœurs solitaires.</p>\r\n<p></p>\r\n<p style=\"line-height:15px;margin-bottom:0cm;text-align:left;\">Si vous êtes déjà en couple et que vous voulez renforcer votre amour, le quartz rose peut vous aider à créer une ambiance romantique et à raviver la flamme.</p>\r\n<p></p>\r\n<p style=\"line-height:15px;margin-bottom:0cm;text-align:left;\">C\'est la pierre idéale pour les soirées en tête à tête, les dîners aux chandelles et les câlins devant la cheminée (ou devant Netflix, c\'est selon vos préférences).</p>\r\n<p></p>\r\n<p style=\"line-height:15px;margin-bottom:0cm;text-align:left;\"></p>\r\n<p></p>\r\n<p style=\"line-height:15px;margin-bottom:0cm;text-align:left;\">Le quartz rose, c\'est aussi la pierre de la bienveillance</p>', 'quartz-rose-', '', '', '', 'Quartz Rose', '', '', '', ''),
