(3, 1, 1, '<p>Nom du produit: Jaspe Rouge</p>\r\n<p>Matériau : 100% pierre de Jaspe rouge naturel<br /><br />Couleur : comme l\'image<br /><br />Quantité : 1 pièce<br /><br />Forme : comme l\'image<br /><br />Niveau : haute qualité : (AAAA +)</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"><iframe width=\"425\" height=\"350\" src=\"http://www.youtube.com/embed/7EOwznwfrk0\"></iframe></p>\r\n<p></p>', '<p style=\"line-height:100%;margin-bottom:0cm;\">Le jaspe rouge, c\'est la pierre de la puissance !</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Si vous avez l\'impression de n\'avoir aucune autorité sur votre vie ou sur les gens qui vous entourent, le jaspe rouge est fait pour vous.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Cette pierre va vous donner la force de caractère nécessaire pour affronter les épreuves de la vie et pour imposer votre volonté.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">C\'est une pierre de l\'équilibre et de l\'harmonie, qui vous aidera à trouver un juste milieu entre la fermeté et la douceur.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Si vous êtes trop conciliant, le jaspe rouge vous donnera le courage de dire non ; si vous êtes trop autoritaire, il vous apprendra à écouter les autres.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Le jaspe rouge, c\'est aussi la pierre de la protection.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Si vous êtes constamment stressé ou anxieux, le jaspe rouge vous protégera des mauvaises vibrations et vous aidera à rester calme et serein.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"></p>', 'jaspe-rouge-', '', '', '', 'Jaspe Rouge', '', '', '', ''),
