(4, 1, 1, '<p>Nom du produit : Œil-de-tigre</p>\r\n<p>Matériau : 100% pierre d\'Œil-de-tigre naturel<br /><br />Couleur : comme l\'image<br /><br />Quantité : 1 pièce<br /><br />Forme : comme l\'image<br /><br />Niveau : haute qualité : (AAAA +)</p>\r\n<p></p>\r\n<p><iframe width=\"425\" height=\"350\" src=\"http://www.youtube.com/embed/p_ze28ddyNM\"></iframe></p>', '<p style=\"line-height:100%;margin-bottom:0cm;\">Les pierres œil-de-tigre, c\'est la pierre de la confiance en soi !</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Si vous avez l\'impression de manquer de courage ou de ne pas être à la hauteur, ces petites merveilles vont vous donner un coup de boost.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Elles vont vous donner l\'énergie nécessaire pour affronter vos peurs et vos doutes, et pour aller de l\'avant.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">C\'est une pierre de l\'équilibre et de l\'harmonie, qui vous aidera à trouver un juste milieu entre la force et la douceur.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Si vous êtes trop timide, les pierres œil-de-tigre vous donneront le courage de prendre la parole ; si vous êtes trop impétueux, elles vous apprendront à réfléchir avant d\'agir.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Les pierres œil-de-tigre, c\'est aussi la pierre de la chance.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"></p>', 'oeil-de-tigre', '', '', '', 'Œil-de-tigre', '', '', '', ''),
