(5, 1, 1, '<p>Nom du produit : Améthyste </p>\r\n<p>Matériau : 100% pierre d\'Améthyste naturel<br /><br />Couleur : comme l\'image<br /><br />Quantité : 1 pièce<br /><br />Forme : comme l\'image<br /><br />Niveau : haute qualité : (AAAA +)</p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p><iframe width=\"425\" height=\"350\" src=\"http://www.youtube.com/embed/lXDuHGq4wSI\"></iframe><br /><br /></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"></p>', '<p style=\"line-height:100%;margin-bottom:0cm;\">L\'améthyste, c\'est la pierre de la sagesse !</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Si vous avez l\'impression de tourner en rond ou de ne pas savoir quoi faire de votre vie, cette pierre va vous aider à trouver la voie.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Elle va vous donner la clarté d\'esprit nécessaire pour prendre les bonnes décisions et pour réaliser vos rêves.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Mais attention, l\'améthyste ne va pas vous rendre sérieux et ennuyeux.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">C\'est une pierre de la créativité et de la liberté, qui vous aidera à libérer votre esprit et à explorer de nouvelles idées.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Si vous êtes trop rigide, l\'améthyste vous donnera la flexibilité nécessaire pour adapter vos projets aux imprévus ; si vous êtes trop dispersé, elle vous apprendra à vous concentrer.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">L\'améthyste, c\'est aussi la pierre de Gaya, la planète de la paix et de l\'harmonie.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\"></p>', 'amethyste-', '', '', '', 'Améthyste', '', '', '', ''),
