(15, 1, 1, '<ul class=\"a-unordered-list a-nostyle a-vertical a-spacing-none detail-bullet-list\" style=\"margin:0px 0px 1px 18px;color:#0f1111;padding:0px;font-family:\'Amazon Ember\', Arial, sans-serif;font-size:14px;background-color:#ffffff;\">\r\n<li style=\"list-style:none;margin:0px 0px 5.5px;\">\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Dimensions du colis ‏ : ‎ 23.5 x 15 x 1.7 cm; 40 grammes</p>\r\n</li>\r\n</ul>', '<p style=\"line-height:100%;margin-bottom:0cm;\">Vous cherchez un moyen de vous protéger des mauvais rêves et de vous envoler vers de nouveaux horizons ?</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Ces attrape-rêves à plumes sont faits pour vous !</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Avec leur forme aérienne et leur toile fine, ils sont parfaits pour capturer les cauchemars et laisser passer les rêves agréables.</p>\r\n<p></p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Et grâce à leurs plumes colorées et élégantes, ils sont aussi une jolie décoration pour votre chambre. Alors n\'hésitez plus et offrez-vous ces attrape-rêves à plumes pour des nuits de rêve paisibles et envoûtantes !</p>', 'attrape-reves-a-plumes', '', '', '', 'Attrape-rêves à Plumes', '', '', '', ''),
