INSERT INTO `ps_supplier_lang` (`id_supplier`, `id_lang`, `description`, `meta_title`, `meta_keywords`, `meta_description`) VALUES
(1, 1, '<p style=\"line-height:100%;margin-bottom:0cm;\">Tenzin est un moine tibétain au grand cœur et à la grande sagesse.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Il passe ses journées à parcourir les montagnes, à la recherche de cailloux magiques aux pouvoirs extraordinaires.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Sa quête est loin d\'être facile, mais Tenzin ne se décourage jamais.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Il est persévérant et déterminé, et il sait que chaque caillou qu\'il trouve lui rapproche un peu plus de la sérénité et de la paix intérieure qu\'il recherche.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Mais ne vous y trompez pas, Tenzin n\'est pas qu\'un moine sérieux et studieux.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">C\'est aussi un grand rigolo qui aime faire des blagues et s\'amuser avec ses amis.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Il aime raconter des histoires et partager ses aventures de caillou-chasseur avec tous ceux qui veulent l\'entendre.</p>\r\n<p style=\"line-height:100%;margin-bottom:0cm;\">Alors, si vous avez besoin d\'un bon rire et d\'un peu de sagesse, rendez-vous auprès de Tenzin, le moine tibétain le plus cool de toutes les montagnes !</p>', '', '', ''),
